/*-----------------------------------------------------------------------------------------------------------
	SOCSO Progression
-----------------------------------------------------------------------------------------------------------*/
Begin
SOCSOProLoop: FOR SOCSOPro AS Dynamic Scroll Cursor FOR 
   SELECT PayEmployee.EmployeeSysId AS OUT_EmployeeSysId, Employee.DateOfBirth AS OUT_DateOfBirth,
          SOCSOProgression.SOCSOProgSchemeId AS OUT_SOCSOProgSchemeId,
          SOCSOProgression.SOCSOP1Payment AS OUT_SOCSOP1Payment,	
          SOCSOProgression.SOCSORemarks AS OUT_SOCSORemarks		  
   FROM PayEmployee 
   JOIN SOCSOProgression ON PayEmployee.EmployeeSysId = SOCSOProgression.EmployeeSysId
   JOIN Employee ON PayEmployee.EmployeeSysId = Employee.EmployeeSysId  
   WHERE SOCSOCurrent = 1 AND SOCSOEffectiveDate < '2016-06-01' AND SOCSOProgSchemeId != ''
         AND (LastPayDate = '1899-12-30' Or LastPayDate >= '2016-06-01')
   ORDER BY PayEmployee.EmployeeSysId
   DO
     IF NOT EXISTS(SELECT * FROM SOCSOProgression WHERE SOCSOEffectiveDate = '2016-06-01' AND EmployeeSysId = OUT_EmployeeSysId) THEN
                   SOCSOProgPolicyId, SOCSOProgSchemeId, SOCSOP1Payment, SOCSORemarks)
	VALUES (OUT_EmployeeSysId,'2016-06-01','',0,'SOCSOYr2016Jun',OUT_SOCSOProgSchemeId,OUT_SOCSOP1Payment,OUT_SOCSORemarks);
     END IF;	    
   END FOR;	  
;
End;

Begin
SOCSOProLoop: FOR SOCSOPro AS Dynamic Scroll Cursor FOR 
   SELECT PayEmployee.EmployeeSysId AS OUT_EmployeeSysId, Employee.DateOfBirth AS OUT_DateOfBirth,
          SOCSOProgression.SOCSOProgSchemeId AS OUT_SOCSOProgSchemeId,
          SOCSOProgression.SOCSOP1Payment AS OUT_SOCSOP1Payment,	
          SOCSOProgression.SOCSORemarks AS OUT_SOCSORemarks		  
   FROM PayEmployee 
   JOIN SOCSOProgression ON PayEmployee.EmployeeSysId = SOCSOProgression.EmployeeSysId
   JOIN Employee ON PayEmployee.EmployeeSysId = Employee.EmployeeSysId  
   WHERE SOCSOCurrent = 1 AND SOCSOEffectiveDate >= '2016-06-01' AND SOCSOProgSchemeId != ''
         AND (LastPayDate = '1899-12-30' Or LastPayDate >= '2016-06-01')
   ORDER BY PayEmployee.EmployeeSysId

   DO
       Update SOCSOProgression Set SOCSOProgPolicyId ='SOCSOYr2016Jun'
        Where EmployeeSysId = OUT_EmployeeSysId AND SOCSOEffectiveDate >= '2016-06-01' AND SOCSOProgPolicyId='SOCSOYr2013Jan' ;	    
   END FOR;	  
;
End;

